import React from 'react'
import { Props } from './Alies';

type Props2 =  Props & {
  value: string;
};

const PassIsComplete:React.FC<Props2> = ({register,value})  => {
    if (value === "Pass"){
        return (
          <>
              <div className="mx-2 mt-2"><h5>Completed or Not</h5></div>
                  <select {...register("pass_iscomplete",{ setValueAs: (value) => Boolean(value)})} className="col-10 col-sm-3">
                      <option value="">-</option>
                      <option value="complete">Complete</option>
                      <option value="incomplete">Incomplete</option>
                      <option value="Interception">Interception</option>
                  </select>
          </>
        )
      }
      return null   
}

export default PassIsComplete
